--
-- Name: view_creacion_cuestionario; Type: VIEW; Schema: public; Owner: postgres
--

CREATE VIEW public.view_creacion_cuestionario AS
 SELECT de.cns_det_respuesta,
    de.cns_det_encuesta,
    r.idrespuesta,
    de.idpregunta,
    r.nom_respuesta,
    de.idencuesta,
    t.idtipo
   FROM ((((public.det_cat_respuesta dc
     JOIN public.respuesta r ON ((dc.idrespuesta = r.idrespuesta)))
     JOIN public.det_encuesta de ON ((de.cns_det_respuesta = dc.cns_det_respuesta)))
     JOIN public.cat_respuesta c ON ((dc.idcatalogo_r = c.idcatalogo_r)))
     JOIN public.tipo t ON ((c.idtipo = t.idtipo)))
  ORDER BY de.cns_det_encuesta;


ALTER TABLE public.view_creacion_cuestionario OWNER TO postgres;

